', 'A: Jalan nafas paten, B: RR : 24 x/menit Spo2 97 Þngan NK 3 lpm, pengembangan dada simetris, suara paru rhonki -/- C: Akral hangat, nadi kuat, CRT &lt; 3 detik, TD : 100/52 mmHg (MAP 68 mmHg), Nadi : 88 x/menit, Tgl 2/8/25 terpasang IVFD di TAKI no. 20 vemplon, tgl 3/8/25 TAKA no 22 vemplon, derajat plebitis 0. D: Kesadaran Composmentis GCS E4M6V5, Pupil 2/2 RC +/+, kekuatan otot 5/5/5/5 E: suhu 36,5 C, Terpasang DC tanggal 3/8/2025 produksi urine (+) warna kuning keruh terdapat stosel merah di selang urine, diuresis :  CC/Kgbb/jam. Terdapat hernia di skrotalis. Hasil laboratorium tgl 3/8/25 HB 14,6 HT 43 leukosit 19,5 trombosit 401.000 ,natrium 140 kalium 3,5 chlorida 102. Troponin T &lt; 40, ureum 36 creatinin 1,3. Post loading aspilet 4tab,CPG 4 tab,atorvastatin 2 tab tgl 3/8/25. Post trombolitik tgl 3/8/25 jam 21.10

', 'Nyeri Akut, Penurunan Curah Jantung, Intoleran Aktifitas

', 'Setelah dilakukan tindakan keperawatan 2x24 jam tingkat nyeri menurun dengan kriteria hasil : Keluhan nyeri menurun, Meringis menurun. Setelah dilakukan tindakan keperawatan 3x24 jam diharapkan curah jantung meningkat dengan kriteria hasil : kekuatan nadi perifer meningkat, lelah menurun, dispnoe menurun, oliguria menurun, tekanan darah membaik. Setelah dilakukan tindakan keperawatan selama 3x24 jam Toleransi Aktivitas Meningkat Kriteria Hasil :Frekuensi nadi meningkat, Saturasi oksigen meningkat, Kemudahan dalam melakukan aktivitas sehari-hari meningkat

', '', '', '', '', '', '', '', '', '2060', '1', 'Intervensi Mandiri :<div>Identifikasi lokasi, karakteristik, durasi, frekuensi, kualitas, intensitas nyeri, Identifikasi skala nyeri, Identifikasi respons nyeri non verbal, Identifikasi tanda dan gejala sekunder penurunan curah jantung. Monitor tekanan darah. Monitor saturasi oksigen. Monitor input dan output cairan (mis. Jumlah dan karakteristik). Periksa sirkulasi perifer secara menyeluruh,Identifikasi kemungkinan penyebab hiperglikemia,Identifikasi gangguan fungsi tubuh yang mengakibatkan kelelahan Monitor kelelahan fisik dan emosional,Monitor pola dan jam tidur,Monitor lokasi dan ketidaknyamanan selama melakukan aktivitas.</div><div>Intervensi Kolaborasi :</div><div>- EKG/ hari</div><div>- Rencana rujuk pro primary PCI, pasien menolak SP (+)</div><div><br></div>', NULL, '2060', 0, NULL, '2025-08-04 11:55:30')
